INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 1, 126401, "クローチェ", 10001, "2023/06/30 12:00:00", 1, "2023/09/22 14:59:59", -470.0, "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", 2, 2002, 1, 1.47);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 126401, "クローチェ", 10002, "2023/06/30 12:00:00", 1, "2023/09/22 14:59:59", -470.0, "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪", 1, 2002, 2, 2.15);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 126501, "ライラエル", 10003, "2023/06/30 12:00:00", 1, "2023/09/22 14:59:59", -470.0, "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", 2, 2002, 1, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 1, 126501, "ライラエル", 10004, "2023/06/30 12:00:00", 1, "2023/09/22 14:59:59", -470.0, "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 1, 2002, 2, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 127702, "リンド", 10005, "2023/09/15 15:00:00", 2, "2023/12/22 14:59:59", -470.0, "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 2, 2002, 1, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 127702, "リンド", 10006, "2023/09/15 15:00:00", 2, "2023/12/22 14:59:59", -470.0, "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 2, 2002, 2, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 1, 127802, "ヴルム", 10007, "2023/09/15 15:00:00", 2, "2023/12/22 14:59:59", -470.0, "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 1, 2002, 1, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 127802, "ヴルム", 10008, "2023/09/15 15:00:00", 2, "2023/12/22 14:59:59", -470.0, "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 1, 2002, 2, 6.5);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 129602, "アネモネ", 10009, "2023/12/15 15:00:00", 3, "2024/03/22 14:59:59", -470.0, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 1, 2002, 1, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 129602, "アネモネ", 10010, "2023/12/15 15:00:00", 3, "2024/03/22 14:59:59", -470.0, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 1, 2002, 2, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 1, 129701, "ネフィ=ネラ", 10011, "2023/12/15 15:00:00", 3, "2024/03/22 14:59:59", -470.0, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 1, 2002, 1, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 129701, "ネフィ=ネラ", 10012, "2023/12/15 15:00:00", 3, "2024/03/22 14:59:59", -470.0, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 1, 2002, 2, 6.2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 3, 130301, "カノン", 10013, "2024/03/15 15:00:00", 4, "2024/06/22 14:59:59", -470.0, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 5, 2002, 1, 3.1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 3, 130301, "カノン", 10014, "2024/03/15 15:00:00", 4, "2024/06/22 14:59:59", -470.0, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 2, 2002, 2, 6.15);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 130401, "ナーナ", 10015, "2024/03/15 15:00:00", 4, "2024/06/22 14:59:59", -470.0, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 2, 2002, 1, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 130401, "ナーナ", 10016, "2024/03/15 15:00:00", 4, "2024/06/22 14:59:59", -470.0, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 1, 2002, 2, 3.35);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 1, 130502, "ホウオウ", 10017, "2024/06/15 15:00:00", 5, "2024/09/22 14:59:59", -470.0, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 1, 2002, 1, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 130502, "ホウオウ", 10018, "2024/06/15 15:00:00", 5, "2024/09/22 14:59:59", -470.0, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 1, 2002, 2, 3.18);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 4, 130503, "ホウオウ", 10019, "2024/06/15 15:00:00", 5, "2024/09/22 14:59:59", -470.0, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 4, 2002, 3, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 1, 123301, "ネア", 10020, "2024/06/15 15:00:00", 5, "2024/09/22 14:59:59", -470.0, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 2, 2002, 1, 4.9);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 1, 123301, "ネア", 10021, "2024/06/15 15:00:00", 5, "2024/09/22 14:59:59", -470.0, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 2, 2002, 2, 4.8);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 3, 133301, "カリザ", 10022, "2024/09/15 15:00:00", 6, "2024/12/22 14:59:59", -470.0, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 1, 2002, 1, 4.922);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 3, 133301, "カリザ", 10023, "2024/09/15 15:00:00", 6, "2024/12/22 14:59:59", -470.0, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 5, 2002, 2, 9.638);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 1, 133401, "ミーア", 10024, "2024/09/15 15:00:00", 6, "2024/12/22 14:59:59", -470.0, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 2, 2002, 1, 2.88);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 5, 133401, "ミーア", 10025, "2024/09/15 15:00:00", 6, "2024/12/22 14:59:59", -470.0, "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 1, 2002, 2, 4.818);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 133002, "グレイス", 10026, "2024/12/15 15:00:00", 7, "2025/03/22 14:59:59", -470.0, "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 1, 2002, 1, 1.78);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 1, 133002, "グレイス", 10027, "2024/12/15 15:00:00", 7, "2025/03/22 14:59:59", -470.0, "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 7, 2002, 2, 6.15);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 6, 133102, "ヴァイオレット", 10028, "2024/12/15 15:00:00", 7, "2025/03/22 14:59:59", -470.0, "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 2, 2002, 1, 4.28);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 1, 133102, "ヴァイオレット", 10029, "2024/12/15 15:00:00", 7, "2025/03/22 14:59:59", -470.0, "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 1, 2002, 2, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 136902, "ルルィ", 10030, "2025/03/15 15:00:00", 8, "2025/06/23 14:59:59", -470.0, "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", 1, 2002, 1, 5.53);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 9, 136902, "ルルィ", 10031, "2025/03/15 15:00:00", 8, "2025/06/23 14:59:59", -470.0, "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", 7, 2002, 2, 6.05);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 137001, "デュラン", 10032, "2025/03/15 15:00:00", 8, "2025/06/23 14:59:59", -470.0, "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", 1, 2002, 1, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 137001, "デュラン", 10033, "2025/03/15 15:00:00", 8, "2025/06/23 14:59:59", -470.0, "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", 1, 2002, 2, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 135902, "サツキ", 10034, "2025/06/16 15:00:00", 9, "2025/09/23 14:59:59", -470.0, "おう\n好きなもん持ってきな", 2, 2002, 1, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 1, 135902, "サツキ", 10035, "2025/06/16 15:00:00", 9, "2025/09/23 14:59:59", -470.0, "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ", 6, 2002, 2, 4.935);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 135802, "ユキノ", 10036, "2025/06/16 15:00:00", 9, "2025/09/23 14:59:59", -470.0, "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？", 5, 2002, 1, 7.441);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 7, 135802, "ユキノ", 10037, "2025/06/16 15:00:00", 9, "2025/09/23 14:59:59", -470.0, "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？", 7, 2002, 2, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 130901, "クルル", 10038, "2025/09/16 15:00:00", 10, "2025/12/23 14:59:59", -470.0, "クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪", 2, 2002, 1, 2.295);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 1, 130901, "クルル", 10039, "2025/09/16 15:00:00", 10, "2025/12/23 14:59:59", -470.0, "はっ！　ヒーローさんから\nお代なんて頂けないです！\nどうぞどうぞ…え、ダメ？", 6, 2002, 2, 6.281);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 2, 137701, "ヴォルガーノ", 10040, "2025/09/16 15:00:00", 10, "2025/12/23 14:59:59", -470.0, "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！", 1, 2002, 1, 5.549);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (0.0, 3, 137701, "ヴォルガーノ", 10041, "2025/09/16 15:00:00", 10, "2025/12/23 14:59:59", -470.0, "…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！", 6, 2002, 2, 2.64);
